// src/components/Navbar.js
import React from 'react';
import Title from './Title';
import NavLinks from './NavLinks';

const Navbar = () => {
  return (
    <div style={{
      backgroundColor: '#282c34',
      color: '#fff',
      padding: '1rem 2rem'
    }}>
      <Title />
      <NavLinks />
    </div>
  );
};

export default Navbar;
